import React from 'react';
import { chakra } from '@chakra-ui/system';
import Footer from './component/Footer';

function App() {
	return (
		<chakra.div bg={'#141414;'} minHeight={"100vh"}>
			<div>hello world</div>
			<Footer />
		</chakra.div>
	);
}

export default App;
